import React from 'react';

import './App.css';
import { Canvas } from "react-three-fiber";
import { BoxBufferGeometry } from 'three';

function App() {
  return (
    <div className="App">
     <>
     <Canvas> 
       <mesh>
         <BoxBufferGeometry attach="geometry" args={[1,1,1]}/> 
         <meshStandardMaterial attach="material" />
       </mesh>
     </Canvas>
     </>
    </div>
  );
}

export default App;
